import React from 'react';
import './login.scss';

export default function Login() {
    return (
        <div className='login'>
            <form className='loginForm'>
                <input type='text' placeholder='email' className='loginInput' />
                <input type='password' placeholder='password' className='loginInput' />
            </form>
        </div>
    )
}
